import React, { Component } from 'react';
import './home.css';
import Navbar from '../../components/common/navbarPage';
import TextField from '@material-ui/core/TextField';
import styled from 'styled-components';
import SearchIcon from '../../images/LandingPage/03-search.svg';

const SearchField = styled(TextField)`
    width:825px;
    margin-top: 12px;
    && {
        & .MuiFilledInput-input {
            padding: 16px 16px;
        }
        & .MuiFilledInput-root {
            position: relative;
            transition: background-color 200ms cubic-bezier(0.0, 0, 0.2, 1) 0ms;
            background-color: rgba(0, 0, 0, 0.09);
            border-top-left-radius: 0px;
            border-top-right-radius: 0px;
        }
    }
`

class home extends Component {
    state = {
        searchTerm : '',
    }
    render(){
        return (
            <div class="home">
                <Navbar />
                <div class="BGimg"/>
                <div class="SearchSectionContainer" />
                    <div class="SearchContainer">
                        <div class="SearchText">
                            Search By Province
                        </div>
                        <div class="SearchField">
                            <SearchField
                                id="Province-SearchField"
                                placeholder="Province"
                                InputLabelProps={{shrink: true,}}
                                variant="filled"
                                // onChangeText={query => { this.setState({ searchTerm: query }); }}
                                value={this.state.searchTerm}
                            />
                            <button class="SearchButton">
                                    {/* // to={`/searchMap/${this.state.searchTerm}`}> */}
                                <img src={SearchIcon} alt="alt_Search" />
                            </button>
                        </div>
                    </div>
            </div>
        );
    }
}

export default home;
